import React from 'react'
import { makeStyles } from '@mui/styles';

const calStyle = makeStyles({
  cal: {
      display: 'absolute',
      position: 'absolute',
      bottom: '0px',
      margin: 'auto',
      marginTop: '100px',
      textAlign: 'center',
      width: '100%',
      height: '10%',
      backgroundColor: '#F1F2ED'
  },

  logo: {
      width: '100px',
  }
})

export default function calinfo() {
  const classes = calStyle();
  return (
    <div className={classes.cal}>info</div>
  )
}
